import React from 'react';
import {Row, Col} from 'reactstrap';
import '../static/css/projects.css';

export default class Projects extends React.Component {
    constructor(props) {
        super(props);
    }

    render () {
        return (
            <Row style={{padding: 75}}>
                <Col>
                    <h4 className="display-5">Projects</h4>
                </Col>
            </Row>
        );
    }
}
